import React from 'react';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
    itemOuter: {
        margin: "10px",
        border: "solid red 1px"
    }
}));

const InventoryItem = () => {
    const classes = useStyles();
    return (
        <div className={classes.itemOuter}>
            Item
        </div>
    )
}

export default InventoryItem;
